"use strict";

function numKLenSubstrNoRepeats(s, k) {
    let ans = 0;
    let j = 0;
    let mp = {};
    for (let i = 0; i < s.length; i++) {
        let c = s.charAt(i);
        if (c in mp) {
            j = Math.max(j, mp[c] + 1);
        }
        mp[c] = i;
        if (i - j + 1 >= k) {
            ans += 1;
        }
    }
    return ans;
}
